import Questions from "./Question";

const Quiz = () => {
    return (
        <div className="quiz">
            <div>
                <div className="score">Question 1/8</div>
                <Questions />
                <div className="next-button">Next question</div>
            </div>

        </div>
    );
}

export default Quiz;
